\title{Developing Robust Algorithms for Symbolic PolyRule Reasoning}

\author{Anonymous}

\begin{document}

\maketitle

\begin{abstract}
This research explores Symbolic PolyRule Reasoning (SPR), a classification task that determines acceptability of symbolic sequences governed by multi-factor logical rules. We investigate machine learning models, including a baseline recurrent approach and a Transformer-based model, on a new benchmark (SPR\_BENCH). Despite careful tuning, we find that neither approach reaches the anticipated 70\% accuracy target. The results highlight real-world pitfalls, such as rule complexity, overfitting, and representation challenges, underscoring the difficulty of robust SPR. We discuss these challenges and propose directions for improving multi-factor symbolic reasoning in future work.
\end{abstract}

\section{Introduction}
Symbolic classification tasks involving complicated logical rules are often encountered in domains like knowledge management, industrial diagnostics, and NLP pipelines. Unlike simpler single-factor rule systems, multi-factor logical rules require handling multi-constraint predicates, such as object counts, order relations, or color/shape positions \citep{hossain2022rulebasedcb,kamali2024nesycocoan}. Traditional rule-based systems struggle with such added complexity, and recent neuro-symbolic approaches do not always generalize well \citep{sun2025systematicar}. We investigate whether modern machine learning models can effectively learn these multi-factor rules from labeled examples.

Our focus is Symbolic PolyRule Reasoning (SPR), which requires identifying valid sequences under complex poly-factor constraints. We design a curated dataset called SPR\_BENCH to facilitate research in this domain. We hypothesize that advanced sequence models can classify sequences governed by multi-predicate rules more accurately than legacy systems. However, our findings reveal that training large models on such data does not guarantee surpassing a 70\% macro-F1 baseline, highlighting unforeseen pitfalls. These negative or inconclusive outcomes serve to guide future improvements.

\section{Related Work}
Symbolic reasoning with multiple constraints has a long tradition in rule-based classification \citep{hossain2022rulebasedcb}, while hybrid neuro-symbolic frameworks attempt fusions of neural networks with logical rules \citep{marra2024fromsr,ylmaz2016apf}. Although Transformers excel at certain symbolic tasks \citep{brinkmann2024ama}, overfitting and inconsistent generalization remain problematic in multi-factor contexts. Work in neuro-symbolic concept composition illustrates that compositional complexity can hinder straightforward pattern recognition \citep{kamali2024nesycocoan}. Our contribution differs in emphasizing multiple logical factors, including shape or color-based predicates, that significantly increase classification difficulty.

\section{Method}
We define SPR as a binary classification on sequences of discrete symbols where acceptability is determined by combined atomic predicates. Symbolic rules describe conditions like ``the number of a certain symbol is even AND the last symbol belongs to a specific subset'' or ``the sequence maintains a color-count threshold in the middle positions.'' Our dataset generation follows prior guidance on constructing symbolic benchmarks \citep{ylmaz2016apf,tie2025mmlureasonbm}. We then evaluate two model families:

\textbf{Recurrent Baseline (CharBiGRU).} We embed characters and pass them to a bidirectional GRU, trained with binary cross-entropy. Dropout is varied (0.0, 0.1, 0.3, 0.5). Macro-F1 is our main metric.

\textbf{Transformer.} A small Transformer encoder is used to handle potentially longer sequences and multi-factor dependencies \citep{brinkmann2024ama,sun2025systematicar}. We train with two dropout values (0.1, 0.3) to examine the trade-off between overfitting and regularization. We track Matthews Correlation Coefficient (MCC) alongside F1 for thorough evaluation.

\section{Experiments}
We split SPR\_BENCH into train, development, and test sets. Despite systematic tuning, neither approach reached the 70\% target commonly expected for simpler rule-based tasks. We detail these unexpected outcomes below.

\textbf{Recurrent Baseline.} Four dropout rates were tested. The highest test macro-F1 of $0.6883$ occurred at $0.3$ dropout, as shown in \cref{fig:baseline}. This is below the hypothesized threshold. Overfitting patterns emerged in low-dropout scenarios, while higher dropout improved generalization but did not yield major gains over the 70\% mark.

\textbf{Transformer Approach.} With dropout rates of $0.1$ and $0.3,$ the best test macro-F1 was $0.6949$, still below the baseline goal. Validation loss fluctuated, consistent with prior findings that Transformers can overfit on small or complex symbolic data \citep{pesaresi2016anm}. Our best MCC was around $0.39$, indicating moderate predictive correlation.

Key limitations included difficulty generalizing across diverse rule interactions and data representation constraints that hamper learning. The multi-constraint nature of SPR leads to intricate decision boundaries. Data also showed signs of label ambiguity for borderline sequences, reinforcing the complexity of rule-driven classification.

