\hspace{0.5cm}
\subfigure[\textbf{Transformer Performance.}]{\includegraphics[width=0.43\textwidth]{research_transformer_aggregated.png}\label{fig:transformer}}
\caption{Key results for Symbolic PolyRule Reasoning. (a) Baseline CharBiGRU with varying dropout yields a maximum test macro-F1 of about 0.69. (b) A small Transformer model struggles similarly, obtaining around 0.695 final macro-F1 and an MCC near 0.39.}
\end{figure}

\section{Conclusion}
While we anticipated surpassing a 70\% F1 threshold, our empirical results on Symbolic PolyRule Reasoning fell short. We identified practical pitfalls: data representation becomes critical when sequences contain multi-factor constraints; overfitting arises quickly given the complexity of rules; and predicted gains from sophisticated architectures may not materialize without carefully tailored models and larger data coverage. Future directions include building more structured encodings, incorporating specialized neuro-symbolic modules, exploring richer regularization regimes, and investigating interpretability to diagnose model blind spots. We hope that highlighting these negative or inconclusive results spurs improvements in systematic symbolic rule modeling and offers realistic insights into the difficulties of multi-factor logic in neural systems.

